import React, { useState, useEffect, useRef } from "react";
import socket, { requestState, joinSession } from "../../services/socketService";


// Player component - minimal UI for displaying media
export default function Player() {
  const [currentItem, setCurrentItem] = useState(null);
  const [isPlaying, setIsPlaying] = useState(false);
  const [currentTime, setCurrentTime] = useState(0);
  const [volume, setVolume] = useState(1);
  const [isCasting, setIsCasting] = useState(false);
  const [isBuffering, setIsBuffering] = useState(true);
  const mediaRef = useRef(null);



// In Player.jsx
useEffect(() => {
    // Check URL for session ID
    const searchParams = new URLSearchParams(window.location.search);
    const sessionId = searchParams.get('session');

    console.log("Player detected session ID:", sessionId);

    if (sessionId) {
      joinSession(sessionId);
    } else {
      requestState();
    }

    // Rest of your event listeners...
  }, []);

useEffect(() => {
  // Other socket event handlers...

  socket.on("time_update", (data) => {
    setCurrentTime(data.currentTime);

    // Only do major time corrections (if more than 2 seconds off)
    if (mediaRef.current && Math.abs(mediaRef.current.currentTime - data.currentTime) > 2) {
      mediaRef.current.currentTime = data.currentTime;
    }
  });

  // Other code...
}, []);


  // Effect to handle socket events from Caster
  useEffect(() => {
    socket.on("casting_state", (data) => {
      setIsCasting(data.isCasting);

      if (data.isCasting) {
        // Update all state if casting is active
        if (data.currentItem) setCurrentItem(data.currentItem);
        if (data.isPlaying !== undefined) setIsPlaying(data.isPlaying);
        if (data.currentTime !== undefined) setCurrentTime(data.currentTime);
        if (data.volume !== undefined) setVolume(data.volume);
      } else {
        // Reset state if casting is stopped
        setCurrentItem(null);
        setIsPlaying(false);
        setCurrentTime(0);
      }
    });

    socket.on("media_change", (data) => {
      setCurrentItem(data.item);
      setIsPlaying(data.isPlaying);
    });

    socket.on("playback_state", (data) => {
      setIsPlaying(data.isPlaying);
    });

    socket.on("time_update", (data) => {
      setCurrentTime(data.currentTime);
      if (mediaRef.current) {
        mediaRef.current.currentTime = data.currentTime;
      }
    });

    socket.on("volume_change", (data) => {
      setVolume(data.volume);
      if (mediaRef.current) {
        mediaRef.current.volume = data.volume;
      }
    });

    // Request current state when connecting
    requestState();

    return () => {
      socket.off("casting_state");
      socket.off("media_change");
      socket.off("playback_state");
      socket.off("time_update");
      socket.off("volume_change");
    };
  }, []);

  // Effect to sync media playback state
  useEffect(() => {
    if (mediaRef.current) {
      if (isPlaying) {
        mediaRef.current
          .play()
          .catch((e) => console.error("Playback error:", e));
      } else {
        mediaRef.current.pause();
      }
    }
  }, [isPlaying, currentItem]);

  const handleTimeUpdate = () => {
    if (mediaRef.current) {
      setCurrentTime(mediaRef.current.currentTime);

      // If you're in control of playback (not needed for normal Player)
      // This is only needed if Player can control playback
      // if (isControlling) {
      //   emitTimeUpdate({
      //     currentTime: mediaRef.current.currentTime,
      //   });
      // }
    }
  };

  // Function to handle video ending
  const handleMediaEnded = () => {
    // In the Player, we typically don't need to do anything when media ends
    // The Caster will tell us what to do next

    console.log("Media playback ended");

    // If you want to show some UI indication that playback ended:
    setIsPlaying(false);
  };

  return (
    <div className="h-screen w-screen bg-black flex flex-col relative">
      <div className="absolute top-4 left-4 z-10">

      </div>
      <div className="flex-1 flex items-center justify-center overflow-hidden">
      {isCasting ? (
        currentItem && currentItem.type === "video" ? (
         <video
  ref={mediaRef}
  src={currentItem.path}
  className="max-h-full max-w-full"
  preload="auto"
  playsInline
  onTimeUpdate={handleTimeUpdate}
  onEnded={handleMediaEnded}
  onWaiting={() => setIsBuffering(true)}
  onCanPlay={() => {
    console.log("Video can play, buffering...");
    setTimeout(() => {
      setIsBuffering(false);
      // Let the useEffect handle the play/pause
    }, 3000); // 3-second buffer
  }}
/>
        ) : currentItem && currentItem.type === "image" ? (
          <img
            src={currentItem.path}
            alt={currentItem.name}
            className="max-h-full max-w-full object-contain"
          />
        ) : (
          <div className="text-gray-500">Waiting for media...</div>
        )
      ) : (
        <div className="text-center p-8">
          <div className="text-4xl text-gray-500 mb-4">Waiting for Cast</div>
          <p className="text-gray-400">
            The caster needs to press "Start Casting" to begin streaming content
            to this player.
          </p>
        </div>
      )}
    </div>
    </div>
  );
}
